    "probing-the-practicality-of-sustained-yield-cropping-of-st-vincent-islands-raccoon-populat",nt"isopen":
    false,nt"url": null,nt"notes": "Predation by raccoons on nests of sea turtles
    on St. Vincent Island has long been noted. This destruction probably plays an important
    role in slowing the recovery of the endangered sea turtle population. In addition,
    the high raccoon concentration on the island represents am economic asset that could
    be used without jeopardizing the wildlife or reducing the aesthetic values of the
    refuge. Perhaps ultimately a reduction of the current level of population would
    be of benefit to the species by heading off an outbreak of an epizootic disease.
    Harvesting the fur crop on a sustained yield basis is an accepted procedure on many
    other refuges and could be made a part of the St. Vincent operations.",nt"license_title":
